text:
Trump’s tariffs are hitting small businesses hard, and people keep asking, “Why not just manufacture in the U.S.?”

@HaleyPavone from @PashionFootwear lays out exactly why that’s not just difficult — it’s impossible for many businesses right now. 

I sent a letter to the Trump Administration urging them to exempt small businesses from these reckless tariffs. They shouldn’t be collateral damage in a trade war they didn’t ask for.

The Trump-Vance Administration is recklessly playing with people’s lives and livelihoods here.

With all the chaos and confusion of this illegal federal funding freeze, people don’t know whether they’ll be laid off from their jobs, have access to health care, send their kids to school, or be able to feed their family.

@WhiteHouse @POTUS need to give everyone answers now.
